import React, {Component} from 'react'
import queryString from 'query-string'
import axios from 'axios'

class LoadStreamers extends React.Component{
  render(){
    const { infoSend, infoId } = this.props
    return (
      <div className="text-white"> {infoId}. { infoSend } </div>
    )
  }
}

export default LoadStreamers
